import React from 'react';
import './App.css';
import Navbar from './layouts/Navbar';
import Footer from './layouts/Footer';
import Landing from './layouts/Landing';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Landing />
      <Footer />
    </div>
  );
}

export default App;
